import { Fragment } from "react";

function WordDictionary({data}){
    const items = [
        {
            title : "Definition:",
            content : data.meanings[0].definitions[0].definition
        },
        {
            title : "Parts of speech:",
            content : data.meanings[0].partOfSpeech
        },
        {
            title : "Synonyms:",
            content : data.meanings[0].synonyms[0]
        },
        {
            title : "Antonyms:",
            content : data.meanings[0].antonyms[0]
        }
    ]
    const renderedTitle = items.map(item => <th className="p-2 pe-3">{item.title}</th>)
    const renderedContent = items.map(item => <th className="p-2 pe-3">{item.content}</th>)
    return(
        <table>
            <tr>
               {renderedTitle}
                {renderedContent}
            </tr>
        </table>
    )
}
export default WordDictionary;
